import React, { Component } from "react";
import { Col, Panel } from 'react-bootstrap';
import HeaderBar from './../master/HeaderBar';
import './HomePage.css';
import Selfie from './../img/HalfFace.jpg';
import Gear from './../img/GearIcon.svg';
import Shovel from './../img/ShovelIcon.svg';
import Runner from './../img/RunnerIcon.svg';
import Airplane from './../img/AirplaneIcon.svg';

class HomePage extends Component {
    render() {
        return (
            <div>
                <HeaderBar title="JM Miller Consulting" />
                <Panel className="page-contents-panel" style={{ width: "66%", margin: "0 16%" }}>
                    <hr style={{ background: "lightblue" }} />
                    <h4>Jonathan M Miller</h4>
                    <h5>...Who?</h5>
                    <br />

                        <Col lg={5} sm={12} style={{ float: "left" }}>
                            <img style={{ width: "100%", margin: "2% " }} src={Selfie}></img>
                        </Col>
                        <Col lg={3} sm={12} style={{ float: "left" }}>
                            <p className="description-thing-list" style={{ width: "100%" }}>
                                <p>I'm Jonathan Miller</p>
                                <p className="write-software">I write software&nbsp;&nbsp;<div className="UnderscoreIcon">&nbsp;</div></p>
                                <p className="build-things">I build things&nbsp;&nbsp;<img className="GearIcon" style={{width:"16px"}} src={Gear}/></p>
                                <p className="volunteer">I volunteer&nbsp;&nbsp;<img className="ShovelIcon" style={{width:"16px"}} src={Shovel}/></p>
                                <p className="run-trails">I run trails&nbsp;&nbsp;<span><img className="RunnerIcon" style={{width:"16px"}} src={Runner}/></span></p>
                                <p className="go-places">I go places&nbsp;&nbsp;<span><img className="AirplaneIcon" style={{width:"16px"}} src={Airplane}/></span></p>
                                <p>I tell stories</p>
                                <p>I solve problems</p>
                                <br />
                            </p>

                        </Col>
                        <Col lg={12} style={{ float: "none", clear: "both" }}>
                            <p>
                                If you're looking at this site, there's a pretty good chance that you either know me or you want to know me. Or, better yet, you're just a curious reader at the end of a trail of purple hyperlinks. 
                            </p>
                            <p>
                                In any case, I'm glad you're here and I hope you'll take a look at the work I've done and the stories I've told.
                            </p>
                        </Col>
                </Panel>
            </div>
        )
    }

}

export default HomePage;
